import { createSelector } from 'reselect'

const selectShop = state => state.shop;

export const selectShopCollections = createSelector(
    [selectShop],
    shop => shop.collections
)

export const selectShopColelctionsCategory = (collectionId) => createSelector(
    [selectShop],
    shop => shop.collections.find(collection => collection.id == collectionId)
)
